import React from 'react'
//import axios from 'axios'
//import styles from 'App.module.scss'
import Dashboard from './Dashboard' 
import store from 'redux'

class App extends React.Component {

	render () {
		return (
			<>
				<Provider store={store}>
					<Dashboard/>
				</Provider>
			</>
		)
	}
}

export default App
